import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Weather from './app_component/weather.component';
import 'weather-icons/css/weather-icons.css';

var API_KEY = '736bd14909acbea016b73866fb5f9885';

class App extends React.Component {

  constructor() {
    super();
     this.state = {};
     this.getWeather();
  }

  getWeather = async () => {
    const api_call = await fetch(`https://api.openweathermap.org/data/2.5/weather?q=Fremont&appid=${API_KEY}`);
    const response = await api_call.json();
    console.log(response);
  }

  render() {
    return (
      <div className="App">
        <Weather/>
      </div>
    );
  }
}

export default App;
